import logo from './logo.svg';
import './App.css';
import Creatie, {NotSoCreatie} from './components/creaty'
import Count from './components/counter/Count';
import 'bootstrap/dist/css/bootstrap.css';

function App() {

  const imgSrc = "https://www.jeduka.com/storage/newsletter/1600436299_Top_100_Universities_in_USA.jpg";
  let cnt = 0;

  return (
    <div className="App">
      <h1> Hello World </h1>
      <img src={imgSrc} alt="University Image"/>
      <Count by={1} onCountClickCallback={onCountClick}/>
      <Count by={5} onCountClickCallback={onCountClick}/>
      <h4>{cnt}</h4>
    </div>
  );

  const onCountClick = (by) => {
      cnt += by;
  };
}

export default App;
